import ProfileCard from './components/ProfileCard.css';



export default function Homework02() {
    

const profiles = [
  {
  avatar: 'https://www.bing.com/images/search?view=detailV2&ccid=x6RusSx5&id=2F98BF74011670CAB8A0DFC151F95F74A8999807&thid=OIP.x6RusSx58arLDIW-0J3jMAHaHa&mediaurl=https%3a%2f%2fcdn-icons-png.flaticon.com%2f512%2f4794%2f4794936.png&cdnurl=https%3a%2f%2fth.bing.com%2fth%2fid%2fR.c7a46eb12c79f1aacb0c85bed09de330%3frik%3dB5iZqHRf%252bVHB3w%26pid%3dImgRaw%26r%3d0&exph=512&expw=512&q=%d0%ba%d0%b0%d1%80%d1%82%d0%b8%d0%bd%d0%ba%d0%b0+%d0%bf%d1%80%d0%be%d1%84%d0%b0%d0%b9%d0%bb&simid=608049941182877328&FORM=IRPRST&ck=30A3D3E33B279D5794342EA3BF050445&selectedIndex=0&itb=1&idpp=overlayview&ajaxhist=0&ajaxserp=0',
    name: 'Kateryna Ushenko',
    occupation: 'Developer',
    hobbies: 'Reading, Drawing, Traveling'
   },
   {
    avatar: 'https://www.bing.com/images/search?view=detailV2&ccid=x6RusSx5&id=2F98BF74011670CAB8A0DFC151F95F74A8999807&thid=OIP.x6RusSx58arLDIW-0J3jMAHaHa&mediaurl=https%3a%2f%2fcdn-icons-png.flaticon.com%2f512%2f4794%2f4794936.png&cdnurl=https%3a%2f%2fth.bing.com%2fth%2fid%2fR.c7a46eb12c79f1aacb0c85bed09de330%3frik%3dB5iZqHRf%252bVHB3w%26pid%3dImgRaw%26r%3d0&exph=512&expw=512&q=%d0%ba%d0%b0%d1%80%d1%82%d0%b8%d0%bd%d0%ba%d0%b0+%d0%bf%d1%80%d0%be%d1%84%d0%b0%d0%b9%d0%bb&simid=608049941182877328&FORM=IRPRST&ck=30A3D3E33B279D5794342EA3BF050445&selectedIndex=0&itb=1&idpp=overlayview&ajaxhist=0&ajaxserp=0',
    name: 'Alice Ivanova',
    occupation: 'Software Engineer',
    hobbies: 'Reading, Hiking, Coding'
   },
   {
    avatar: 'https://www.bing.com/images/search?view=detailV2&ccid=x6RusSx5&id=2F98BF74011670CAB8A0DFC151F95F74A8999807&thid=OIP.x6RusSx58arLDIW-0J3jMAHaHa&mediaurl=https%3a%2f%2fcdn-icons-png.flaticon.com%2f512%2f4794%2f4794936.png&cdnurl=https%3a%2f%2fth.bing.com%2fth%2fid%2fR.c7a46eb12c79f1aacb0c85bed09de330%3frik%3dB5iZqHRf%252bVHB3w%26pid%3dImgRaw%26r%3d0&exph=512&expw=512&q=%d0%ba%d0%b0%d1%80%d1%82%d0%b8%d0%bd%d0%ba%d0%b0+%d0%bf%d1%80%d0%be%d1%84%d0%b0%d0%b9%d0%bb&simid=608049941182877328&FORM=IRPRST&ck=30A3D3E33B279D5794342EA3BF050445&selectedIndex=0&itb=1&idpp=overlayview&ajaxhist=0&ajaxserp=0',
    name: 'Anna Brown',
    occupation: 'Software Engineer',
    hobbies: 'Swimming, Running, Movies'
   }
  ];
 
 return (
  <div>
    {profiles.map((profile, index) => (
        <ProfileCard
          key={index}
          avatar={profile.avatar}
          name={profile.name}
          occupation={profile.occupation}
          hobbies={profile.hobbies}
        />
      ))}
  </div>
 );
}
